import React from 'react';
import Dashboard from './pages/Home'; // or Home, or whichever page you want as default

// Fake user data if your dashboard expects users prop
const fakeUsers = [
  { email: 'admin@example.com', lastLogin: 'now' }
];

function App() {
  // Always render the dashboard or home page, never the login
  return (
    <div>
      <Dashboard users={fakeUsers} />
      {/* Or: <Home /> */}
    </div>
  );
}

export default App;
